import './nav.css';
import { Link } from 'react-router-dom';

function Nav() {
  return(

        <nav>
        <Link to="/">
            <h3>Logo</h3>
        </Link>
        <ul className ="nav-links">
            <Link to='/login'>
                <li>Login</li>
            </Link>
            <Link to='/browse'>
                <li>Browse Trails</li>
            </Link>

        </ul>

    </nav>



  );
}

export default Nav;
